import "./todolist.css";

export default function todolist() {
  return (
    <div className="todolist">
      <div className="todolistWrapper">
        <div className="todo-app">
          <h2 className="To-Do-List">To Do List!</h2>
        </div>
      </div>
    </div>
  );
}
